namespace LeetCodeSolve;

public class TestVowelsProblem
{
  public void RunTest()
  {
    var res = MaxVowels("abciiidef", 3);
    Console.WriteLine($"Case 1: {res}");

    res = MaxVowels("aeiou", 2);
    Console.WriteLine($"Case 2: {res}");

    res = MaxVowels("leetcode", 3);
    Console.WriteLine($"Case 3: {res}");

    res = MaxVowels("weallloveyou", 7);
    Console.WriteLine($"Case 4: {res}");

    string sq5 = "";
    res = MaxVowels(sq5, 50436);
    Console.WriteLine($"Case 5: {res}");

  }

  public int MaxVowelsSlow(string s, int k)
  {
    string vowels = "aeiou";
    int nMax = 0;
    int nCur = 0;
    for (var idx = 0; idx < s.Length - k + 1; idx++)
    {
      string subS = s.Substring(idx, k);
      nCur = 0;
      foreach (var c in subS)
      {
        nCur = vowels.Contains(c) ? nCur + 1 : nCur;
        nMax = Math.Max(nMax, nCur);
      }
    }

    return nMax;
  }

  // Sliding Window
  public int MaxVowels(string s, int k)
  {
    string vowels = "aeiou";
    int nMax = 0;
    int nCur = 0;
    k = Math.Min(s.Length, k); // check string as a lest k characters

    // get initial Window
    for (int idx = 0; idx < k; idx++)
    {
      if (vowels.Contains(s[idx]))
      {
        nCur++;
      }
    }
    nMax = nCur;

    // Moving Window
    for (int idx = k; idx < s.Length; idx++)
    {
      // remove the effect of prev windows first cell
      if (vowels.Contains(s[idx - k]))
      {
        nCur--;
      }
      // add the effect of new windows las cell
      if (vowels.Contains(s[idx]))
      {
        nCur++;
      }

      nMax = Math.Max(nMax, nCur);
    }

    return nMax;
  }



}